import React from 'react';
import ReactDOM from 'react-dom';


// create a react component
const App = () => {
  return (
    <div>
      <div>
        <h1>That's What She Said</h1>
        <h3>Click the button to get a quote from The Office!</h3>
      </div>

      <div>
        <form>
          <input type="text"/>
          <button type="submit">Search</button>
        </form>
      </div>

      <div>
        <img src="/images/best-boss.png" alt="World's Best Boss Mug" />
        <div>
          <p>"I think that pretty much sums it up."</p>
          <p>- Michael Gary Scott</p>
        </div>
      </div>

    </div>);
};

// take the react component and show it on the screen
ReactDOM.render(
  <App />,
  document.querySelector('#root')
);
